import React,{Component} from "react"

export const Grid = (arr) => {

    return(
        <div>
            {arr.map((row) => {
                return(
                    <div>
                        {row.map((node) => {
                            return node
                        })}
                    </div>
                )
            })}
        </div>
    )
}
